INSERT INTO `sys_oper_log` (`oper_id`, `title`, `business_type`, `method`, `request_method`, `operator_type`, `oper_name`, `dept_name`, `oper_url`, `oper_ip`, `oper_location`, `oper_param`, `json_result`, `status`, `error_msg`, `oper_time`, `cost_time`) VALUES (191, '字典类型', 1, 'com.ruoyi.web.controller.system.SysDictTypeController.add()', 'POST', 1, 'admin', '济南市', '/system/dict/type', '127.0.0.1', '内网IP', '{\"createBy\":\"admin\",\"dictName\":\"作弊类型\",\"dictType\":\"cheating_type\",\"params\":{},\"remark\":\"超速：\\n\\n键值：overspeed\\n描述：车辆在高速公路上以超过规定速度行驶。\\n行为特征：车速超过路段规定的限速标准。\\n潜在影响：增加交通事故风险，危及交通安全。\\n不按规定车道行驶：\\n\\n键值：improper_lane_usage\\n描述：车辆在高速公路上未按照规定的车道行驶。\\n行为特征：车辆在超车道、应急车道或不合适的车道行驶。\\n潜在影响：引发交通拥堵和事故，影响其他车辆的通行安全。\\n虚报车辆类型：\\n\\n键值：misreport_vehicle_type\\n描述：车辆主人或驾驶员故意提供虚假的车辆类型信息。\\n行为特征：车辆主人或驾驶员错误地声称车辆的类型，以减少通行费用。\\n潜在影响：导致通行费用不准确，损害公共利益和交通管理秩序。\\n无效车牌：\\n\\n键值：invalid_license_plate\\n描述：车辆使用无效或伪造的车牌。\\n行为特征：车辆悬挂的车牌与法定要求不符或者是伪造的。\\n潜在影响：难以对车辆进行追踪和管理，增加交通管理难度和风险。\\n逃费：\\n\\n键值：toll_evasion\\n描述：车辆在收费站通过时故意逃避支付通行费用。\\n行为特征：车辆未按规定的收费方式或通行规则通过收费站。\\n潜在影响：导致通行费用损失，影响收费站的正常运营和资金收入。\\n伪造通行证：\\n\\n键值：forged_pass\\n描述：车辆主人或驾驶员使用伪造的通行证进行通行。\\n行为特征：车辆使用伪造的通行证通过收费站或者路段。\\n潜在影响：破坏通行管理秩序，损害收费管理的公平性和有效性。\",\"status\":\"0\"}', NULL, 1, '\r\n### Error updating database.  Cause: com.mysql.cj.jdbc.exceptions.MysqlDataTruncation: Data truncation: Data too long for column \'remark\' at row 1\r\n### The error may exist in file [F:\\CloudPaylink\\ruoyi-system\\target\\classes\\mapper\\system\\SysDictTypeMapper.xml]\r\n### The error may involve com.ruoyi.system.mapper.SysDictTypeMapper.insertDictType-Inline\r\n### The error occurred while setting parameters\r\n### SQL: insert into sys_dict_type(      dict_name,       dict_type,       status,       remark,       create_by,      create_time    )values(      ?,       ?,       ?,       ?,       ?,      sysdate()    )\r\n### Cause: com.mysql.cj.jdbc.exceptions.MysqlDataTruncation: Data truncation: Data too long for column \'remark\' at row 1\n; Data truncation: Data too long for column \'remark\' at row 1; nested exception is com.mysql.cj.jdbc.exceptions.MysqlDataTruncation: Data truncation: Data too long for column \'remark\' at row 1', '2024-03-03 22:09:43', 30);
